import React from 'react';
import './component/Login.css';

export const Login = () => {
    return (
        <div>
            <div className="title">
                <h1>Fitness Pal</h1>
            </div>
            <div className="login">
                <form>
                    <input type="text" id="username" placeholder="Username" />
                    <input type="password" id="password" placeholder="Password" />
                    <input type="submit" className="submit" id="login" value="Login" />
                </form>
            </div>
        </div>
    );
}
